// components/CourseSchedule.js
import React from 'react';

const CourseSchedule = ({ schedule }) => {
  if (!schedule || schedule.length === 0) {
    return <div>No schedule generated yet.</div>;
  }

  return (
    <div>
      <h2>Generated Course Schedule</h2>
      {schedule.map((quarter, index) => (
        <div key={index}>
          <h3>Quarter {index + 1}</h3>
          <ul>
            {quarter.map((course) => (
              <li key={course._id}>
                {course.id} - {course.name} ({course.credits} credits)
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
};

export default CourseSchedule;
